import React from 'react'
import WorksForm from '../../components/form/WorksForm';
import Introduce from '../../components/UI/Introduce'
import useHeader from '../../hooks/useHeader';
import Proprietary from './Proprietary';
import Recents from './Recents';

const Works = () => {

    useHeader(window.location.pathname);

    console.log("rerender");
    return (
        <main>
            {/* Introduce */}
            <Introduce Page={'works'} />
            {/* End Introduce */}

            {/* Recent Projects */}
            <Recents />
            {/* End Recent Projects */}

            {/* Proprietary Projects */}
            <Proprietary />
            {/* End Proprietary Projects */}

            {/* Works Form */}
            <WorksForm />
            {/* End Works Form */}
        </main>
    )
}

export default Works;
